import React from 'react'
import ReactDOM from 'react-dom'
import './style.css'

function App() {
    const timeOfDay = Date.getHours();
    let printStat;
    if(timeOfDay > 0 && timeOfDay < 12)
        printStat = "Good Morning"

}

ReactDOM.render(<App />, document.getElementById('root'));
